import React from "react";
import { Link } from "react-router-dom";

const Hero = () => {
  return (
    <section className="hero">
      <style>
        {`
          .hero {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            display: flex;
            align-items: center;
            padding: 6rem 0 4rem;
            color: white;
            position: relative;
            overflow: hidden;
          }
          
          .hero::before {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background: url('data:image/svg+xml,<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 100"><defs><pattern id="grain" patternUnits="userSpaceOnUse" width="100" height="100"><circle cx="50" cy="50" r="2" fill="rgba(255,255,255,0.1)"/></pattern></defs><rect width="100%" height="100%" fill="url(%23grain)"/></svg>');
            opacity: 0.3;
          }
          
          .hero-content {
            max-width: 1200px;
            margin: 0 auto;
            padding: 0 2rem;
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 4rem;
            align-items: center;
          }
          
          .hero-text h1 {
            font-size: 3.5rem;
            font-weight: 700;
            margin-bottom: 1.5rem;
            line-height: 1.2;
          }
          
          .highlight {
            background: linear-gradient(45deg, #ffd700, #ffed4e);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
          }
          
          .hero-text p {
            font-size: 1.2rem;
            margin-bottom: 2rem;
            opacity: 0.9;
            line-height: 1.6;
          }
          
          .hero-buttons {
            display: flex;
            gap: 1rem;
          }
          
          .cta-button {
            padding: 1rem 2rem;
            border-radius: 50px;
            text-decoration: none;
            font-weight: 600;
            transition: all 0.3s ease;
            display: inline-block;
          }
          
          .cta-button.primary {
            background-color: #fff;
            color: #667eea;
          }
          
          .cta-button.primary:hover {
            transform: translateY(-3px);
            box-shadow: 0 10px 30px rgba(0,0,0,0.2);
          }
          
          .cta-button.secondary {
            background-color: transparent;
            color: #fff;
            border: 2px solid #fff;
          }
          
          .cta-button.secondary:hover {
            background-color: #fff;
            color: #667eea;
            transform: translateY(-3px);
          }
          
          .hero-stats {
            display: flex;
            justify-content: space-around;
            margin-top: 3rem;
            padding: 2rem;
            background: rgba(255,255,255,0.1);
            border-radius: 15px;
            backdrop-filter: blur(10px);
          }
          
          .stat {
            text-align: center;
          }
          
          .stat h3 {
            font-size: 2rem;
            margin-bottom: 0.5rem;
          }
          
          .stat p {
            opacity: 0.9;
          }
          
          @media (max-width: 768px) {
            .hero-content {
              grid-template-columns: 1fr;
              text-align: center;
              gap: 2rem;
            }
            
            .hero-text h1 {
              font-size: 2.5rem;
            }
            
            .hero-buttons {
              justify-content: center;
              flex-wrap: wrap;
            }
            
            .hero-stats {
              flex-direction: column;
              gap: 1.5rem;
            }
          }
        `}
      </style>

      <div className="hero-content">
        <div className="hero-text">
          <h1>
            Discover Exquisite <span className="highlight">Jewelry</span>{" "}
            Masterpieces
          </h1>
          <p>
            Bid on stunning, authenticated pieces from around the world. Each
            item is carefully curated by our experts for your peace of mind.
          </p>
          <div className="hero-buttons">
            <Link to="/jewelry" className="cta-button primary">
              Browse Collection
            </Link>
            <Link to="/about" className="cta-button secondary">
              Learn More
            </Link>
          </div>
        </div>

        <div className="hero-visual">
          <div className="jewelry-showcase">
            <div className="jewelry-item item-1">
              <div className="sparkle"></div>
            </div>
            <div className="jewelry-item item-2">
              <div className="sparkle"></div>
            </div>
            <div className="jewelry-item item-3">
              <div className="sparkle"></div>
            </div>
          </div>
        </div>
      </div>

      <div className="hero-stats">
        <div className="stat">
          <h3>500+</h3>
          <p>Exclusive Pieces</p>
        </div>
        <div className="stat">
          <h3>98%</h3>
          <p>Customer Satisfaction</p>
        </div>
        <div className="stat">
          <h3>24/7</h3>
          <p>Expert Support</p>
        </div>
      </div>
    </section>
  );
};

export default Hero;
